INSERT INTO feed_back_report_code VALUES ('B8660C5712D22063E0559F2F30A8307E', 'BLR004', 'AcctMthlyBlgInfSgmt', 'R2101215', '当首次上报时（库中不存在该账户），对于不同的 账户类型至少还应包含的信息段如下： 若“账户类型”为“D1”，则还应包含月度表现信 息段， 若“账户类型”为“R1/R3/R4”还应包含月度表现 信息段 若“账户类型”为“R2”，则还应包含月度表现段', null);
INSERT INTO feed_back_report_code VALUES ('B8660C5712D32063E0559F2F30A8307E', 'BLR004', 'AcctCredSgmt', 'R2101215', '当首次上报时（库中不存在该账户），对于不同的 账户类型至少还应包含的信息段如下： 若“账户类型”为“D1”，如果基本信息段中“分 次放款标志”为“是”，则还应包含授信额度信息 段； 若“账户类型”为“R1/R3/R4”还应包含授信额度 信息段； 若“账户类型”为“R2”，如果基本信息段中的“借 贷业务种类细分”不是“大额专项分期卡”，则还 应包含授信额度信息段；', null);
